IF OBJECT_ID('dbo.proc_transform_475', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_475;
GO
CREATE PROCEDURE dbo.proc_transform_475
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_475
    SET payload = LEFT(payload, 1000) + N'|V4-475|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_475;
END
